// This magnificent hack uses assumptions about the XOR key size, known reserved values in the
// vector table, and assumed values in the vector table, which was assumed to be at the
// beginning of the image, to determine the XOR key, then decodes the rest of the image with
// that key.

// Spoiler: It works. Get rekt.

// Assumptions:
// Word-based encryption, probably XOR (small differences between US and EU firmwares)
// 52-byte XOR key (same as POK3R firmware)
// Vector table starts at beginning of image (why not?)
// There are known chunks of zeroes in the vector table (reserved offsets)
// A large number of vector table addresses are duplicated (same as in POK3R firmware)

// Since, key ^ 0 = key, we get the four words of the key below, which we use to decode the
// bits of the generic interrupt, 7335000000, which we use to find the rest of the key in
// part of the vector table that is all the same address repeated (see POK3R vector table)

int main(int argc, char *argv[]){
    unsigned int xor_key[13] = {
        0x00000000, 0x00000000, 0x00000000, 0x00000000,
        0x00000000, 0x00000000, 0x00000000, 0x768CCBD9,
        0xC68B8C2A, 0xA8AD6709, 0x5C0F52D4, 0x00000000,
        0x00000000,
    };

    printf("KEY:\n");

    int k = 0;
    for(k = 0; k < 13; ++k){
        printf("%08x ", xor_key[k]);
    }

    puts("");
    puts("");

    printf("KEY:\n");

    k = 0;
    for(k = 0; k < 13; ++k){
        xor_key[k] = firmware_image[0x68/4 + k] ^ 0x73350000;
        printf("%08x ", xor_key[k]);
    }

    puts("");
    puts("");

    unsigned int decoded[sizeof(firmware_image)];

    int i = 0;
    while(1){
        int j;
    for(j = 0; j < 13; ++j){
        decoded[i+j] = firmware_image[i+j] ^ xor_key[j];
        printf("%08x ", decoded[i+j]);
    }
        i += 13;
    puts("");
    }
}

